import React from "react";
import { Container } from "./SobreStyle";

import SectionOne  from "../../Parts/SobreParts/SectionOne";

import  SectionTwo  from "../../Parts/SobreParts/SectionTwo";
const Sobre = () => {
    return (
        <Container>
            <SectionOne />
            <SectionTwo />
        </Container>
    );
};

export default Sobre;
